import React, { Fragment } from 'react';
import Spinner from '../layout/Spinner';
import Ticket from '../ticket/Ticket';

const DashboardTickets = ({ user, loading }) => {

const { tickets } = user;


  return (
     loading && profile === null ? <Spinner /> : 


    // user === null ? <Spinner /> :   
        <Fragment>
        <div className="dashboard">
        <h1 className='large text-primary'>Welcome {user && user.name}</h1>
        <h2 className='lead'>
          <i className='fas fa-user' />Your movies and tickets 
        </h2>

        </div>  

        {tickets !== null ? (   
        <Fragment>
        <h1 className="displayHeader">Your tickets</h1>
        <div className="displayDash">{tickets.map(item => (         
             <div 
             className="singleTicket"
             key={item._id}>
             <Ticket
               ticket={item}
             />
             </div> 
        ))}
        </div> 
        </Fragment>
         ) : (
         <Fragment>  
              <p>No tickets</p>
          </Fragment>
          )}    
      </Fragment>
    )

  }  

export default DashboardTickets;
